import React from 'react';

const Checkout = () => {
  return (
    <div className="container">
      <h1>Checkout</h1>
      <div className="card">
        <h3>Payment Information</h3>
        <p>Checkout form will be here</p>
      </div>
    </div>
  );
};

export default Checkout;
